import React from "react"

const Jumbotron = ({children}) =>{
    const style = {
        height: "300px",
        width: "500px",
        textAlign: "center"
    }
    return <div className="jumbotron">

            <h3>(React) Google Book Search</h3>
            <h4>Search for and Save Books of Interest</h4>

    </div>
}

export default Jumbotron
